import MoviesDay from "../MoviesDay/MoviesDay";
import NextMovies from "../NextMovies/NextMovies";
import Contact from "../Contact/Contact";

export default function Registration() {
    return (
        <>
            <MoviesDay />
            <NextMovies />
            <Contact />
        </>
    );
}
